import React from 'react';
import { Link } from 'react-bootstrap/lib/Navbar';
import { Navbar, Nav, NavLink } from 'react-bootstrap';


function Header() {
    return (
        <Navbar bg="light" expand="lg" className='shadow-lg mb-5 mt-5 justify-content-center'>
            <Navbar.Brand href="/">Home</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="ml-auto">
                    <Link className='text-decoration-none text-light' href="/about">About</Link>
                    <NaLink className='text-decoration-none text-light' href="/login">Login</NaLink>
                    <NavLink className='text-decoration-none text-light' href="/register">Register</NavLink>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}

export default Header;
